Java interop is done with the extern keyword, which can be used in many contexts with roughly the same meaning of "the thing following this is a Java thing". The simplest way is extern blocks, which can be at the top level (e.g. for imports) or in blocks, and can be multiline with braces or single line with quotes: extern { import battlecode.common.*;
} fn doStuff() { extern "System.out.print(\"Hello, \");"; extern { System.out.println("world!"); }
} You can mark almost any ByteC name as pub to make it visible from Java, as long as it has a type that exists in Java: fn pub makeGreeting(x: str): str = "Hello, " + x;
fn greet(pub name: str) { extern { String greeting = makeGreeting(name); System.out.println(greeting); }
} However, actually writing inline Java code is very rarely necessary. Usually, you'll define the Java API to interact with and then interact with it. This uses extern classes, enums, and functions, which are generally written just like their non-extern variants, but without function bodies. There's also the constructor keyword for class constructor prototypes, although only one can be used for a given class. The names of extern functions can be changed by adding an = "<name>", which is especially important for static methods and overloading (neither of which is natively supported by ByteC). extern class MapLocation { constructor(x: i32, y: i32); let x: i32; let y: i32; fn add(dir: Direction): MapLocation; fn distanceSquaredTo(loc: MapLocation): i32;
} extern enum RobotType { ARCHON, BUILDER, LABORATORY, MINER, SAGE, SOLDIER, WATCHTOWER; let damage: i32; let health: i32; fn canAttack(): bool; fn canMine(): bool;
} extern fn bytecodeNum(): i32 = "Clock.getBytecodeNum";

